import React from 'react';
import TeamInfo from '../../Elements/teamInfo';

const header = (props) => {

    const teamInfo = (team) => {
        return team.length>0 ? (
            <TeamInfo team={team}/>
        ):null;
    }


    return(
        <div>
            {teamInfo(props.teamData)}
        </div>
    )
}

export default header;
